  return (
    <div style={{ textAlign: "center", marginTop: "30px" }}>
      {!joined ? (
        <>
          <input
            placeholder="Nháº­p roomId"
            value={roomId}
            onChange={e => setRoomId(e.target.value)}
          />
          <button onClick={() => setJoined(true)}>Join Room</button>
        </>
      ) : (
        <Board roomId={roomId} />
      )}
    </div>
  );
}

export default App;
